# Description: https://leetcode.com/problems/kth-largest-element-in-an-array/description/
class Solution_useSort:
    def findKthLargest(self, nums: List[int], k: int) -> int:
        nums.sort(reverse=True)
        return nums[k-1]

# Use Partition
# Very slow
# Description: https://leetcode.com/problems/kth-largest-element-in-an-array/description/
class Solution_usePartition:
    def findKthLargest(self, nums: List[int], k: int) -> int:
        elementIndex = -1
        start = 0
        end = len(nums) -1
        k = len(nums) - k
        while start <= end:
            elementIndex = self.partition(nums, start, end)
            # print(nums)
            if elementIndex < k:
                start = elementIndex + 1
            elif elementIndex > k:
                end = elementIndex - 1
            else:
                break
        return nums[elementIndex]

    
    def partition(self, nums: List[int], start: int, end: int) -> int:
        #pivotIndex = random.randint(start, end)
        # print(f"Pivot index: {pivotIndex}")
        pivotIndex = end
        pivot = nums[pivotIndex]
        print(f"Start: {start}, End: {end}, pivot: {pivot}")

        # Swap pivot and end
        # temp = nums[end]
        # nums[end] = nums[pivotIndex]
        # nums[pivotIndex] = temp

        # all elements <= j are smaller than pivot
        j = start -1
        for i in range(start, end):
            if nums[i] < pivot:
                j += 1
                (nums[i], nums[j]) = (nums[j], nums[i])
        (nums[j+1], nums[end]) = (nums[end], nums[j+1])
        return j+1

# Why this solution is faster than my partition solution?
class Solution_quickSelect:
    def findKthLargest(self, nums: List[int], k: int) -> int:
        k = len(nums) - k

        def quickSelect(left, right):
            pivot = nums[right]
            low = left
            high = right
            print(f"Left: {left}, Right: {right}, pivot: {pivot}")

            while low <= high:
                while low <= high and nums[low] < pivot:
                    low += 1
                while low <= high and nums[high] > pivot:
                    high -= 1
                if low <= high:
                    nums[low], nums[high] = nums[high], nums[low]
                    low += 1
                    high -= 1

            if k <= high:
                return quickSelect(left, high)
            elif k >= low:
                return quickSelect(low, right)
            else:
                return nums[k]
        return quickSelect(0, len(nums) - 1)

